import angular from 'angular';
import uiRouter from 'angular-ui-router';
export default angular.module('app', [uiRouter]);

export default function appRoute($stateProvider) {
  $stateProvider.state('ticTac', {
    url: '/',
    template: '<board user="Tade"></board>'
  });
}
appRoute.$inject = ['$stateProvider'];

export default function boardController($scope) {
  $scope.board = 'Test Board';
  console.log($scope.board, $scope.user || 'No user');
}
boardController.$inject = ['$scope'];

/* eslint no-undef: "off" */
import './board.scss';
import template from './board.html';
import boardController from './board';

function board() {
  return {
    scope: {
      user: '@'
    },
    restrict: 'EA',
    controller: boardController,
    template: template
  };
}

export default app.directive('board', board);

import template from './cell.html';

